func main() {
	if err := doit(); err != nil {
		fmt.Fprintf(os.Stderr, "Error: %v\n", err)
		fmt.Fprintf(os.Stderr, "Usage: corpustoinput <corpusdir (optional)>\n")
		os.Exit(1)
		return
	}
}

func doit() error {
	var dir string
	if len(os.Args) > 1 {
		dir = os.Args[1]
	} else {
		home, err := os.UserHomeDir()
		if err != nil {
			return err
		}
		dir = fmt.Sprintf("%v/.cache/go-build/fuzz/github.com/holiman/txparse/Fuzz/", home)
	}
	fmt.Fprintf(os.Stderr, "Using %v to search for corpus\n", dir)
	var vals []any

	handleFile := func(path string) error {
		//fmt.Printf("handleFile(%v)\n", path)
		data, err := ioutil.ReadFile(path)
		if err != nil {
			return err
		}
		lines := bytes.Split(data, []byte("\n"))
		if len(lines) < 2 {
			return fmt.Errorf("must include version and at least one value")
		}
		for _, line := range lines[1:] {
			line = bytes.TrimSpace(line)
			if len(line) == 0 {
				continue
			}
			v, err := parseCorpusValue(line)
			if err != nil {
				return fmt.Errorf("malformed line %q: %v", line, err)
			}
			vals = append(vals, v)
		}
		return nil
	}
	var readDir func(string) error

	readDir = func(dir string) error {
		//fmt.Printf("readDir(%v)\n", dir)
		entries, err := os.ReadDir(dir)
		if err != nil {
			return err
		}

		for _, entry := range entries {
			if entry.IsDir() {
				if err := readDir(filepath.Join(dir, entry.Name())); err != nil {
					return err
				}
			} else {
				if err := handleFile(filepath.Join(dir, entry.Name())); err != nil {
					fmt.Printf("#Error on file %v\n", filepath.Join(dir, entry.Name()))
				}
			}
		}
		return nil
	}
	if err := readDir(dir); err != nil {
		fmt.Printf("Error: %v\n", err)
	}

	if false {
		for _, val := range basecorpus {
			fmt.Printf("%#x\n", common.FromHex(val))
		}
	}
	if true {
		for _, val := range vals {
			fmt.Printf("%#x\n", val)
		}
	}
	return nil
}

// parseCorpusValue is taken mostly from the go internals, in internal/fuzz/encoding.go.
// It has been stripped out, so it only supports []byte types
func parseCorpusValue(line []byte) (any, error) {
	fs := token.NewFileSet()
	expr, err := parser.ParseExprFrom(fs, "(test)", line, 0)
	if err != nil {
		return nil, err
	}
	call, ok := expr.(*ast.CallExpr)
	if !ok {
		return nil, fmt.Errorf("expected call expression")
	}
	if len(call.Args) != 1 {
		return nil, fmt.Errorf("expected call expression with 1 argument; got %d", len(call.Args))
	}
	arg := call.Args[0]

	if arrayType, ok := call.Fun.(*ast.ArrayType); ok {
		if arrayType.Len != nil {
			return nil, fmt.Errorf("expected []byte or primitive type")
		}
		elt, ok := arrayType.Elt.(*ast.Ident)
		if !ok || elt.Name != "byte" {
			return nil, fmt.Errorf("expected []byte")
		}
		lit, ok := arg.(*ast.BasicLit)
		if !ok || lit.Kind != token.STRING {
			return nil, fmt.Errorf("string literal required for type []byte")
		}
		s, err := strconv.Unquote(lit.Value)
		if err != nil {
			return nil, err
		}
		return []byte(s), nil
	}
	return nil, fmt.Errorf("Unsupported type")
}

